import React from 'react'
import styles from '../styles/tabel.module.scss'
import { Edit } from '../assets/icon/Edit'

export const Table = ({ header, body }) => {
    const onAddNewProductPopap = (showPopap) => {
        return showPopap ? <Popap type='Add' productName='' productPrice='' onCloase={onCloasePopapAddNewProduct} /> : null
    }
    return (
        <table className={styles.table}>
            <thead>
                <tr className={styles.tr}>
                    {
                        header ? header?.map((item, index) => {
                            return (<th key={index} className={styles.th}>{item}</th>)
                        }) : null
                    }
                </tr>
            </thead>
            <tbody>
                {
                    body ? body?.map((item, index) => {
                        return (
                            <tr key={index} className={styles.tr}>
                                <td className={styles.td}>{index}</td>
                                <td className={styles.td}>{item.name}</td>
                                <td className={styles.td}>{item.price}</td>
                                <div className={styles.edit}>
                                    <Edit />
                                </div>
                            </tr>
                        )
                    }) : null
                }

            </tbody>
        </table >
    )
}
